  <div class="Container" id="outputContainer">
    <h2>Kopírovatelná tabulka</h2>
  </div>






  <script>

    function orderDatalist() {
        var datalist = document.getElementById('datalistOptions');
        var options = Array.from(datalist.options);
  
        options.sort(function(a, b) {
          return a.value.localeCompare(b.value);
        });
  
        datalist.innerHTML = '';
        options.forEach(function(option) {
          datalist.appendChild(option.cloneNode(true));
        });
      }
  
      orderDatalist();

    function generateTable() {
        // Get input table values
        var inputTable = document.getElementById("inputTable");
        var inputRows = inputTable.getElementsByTagName("tr");
        var outputTable = document.createElement("table");
        outputTable.setAttribute("id", "outtab");
  
        for (var i = 0; i < inputRows.length; i++) {
          var inputCells = inputRows[i].getElementsByTagName("input");
          var outputRow = outputTable.insertRow(i);
  
          for (var j = 0; j < inputCells.length; j++) {
            var outputCell = outputRow.insertCell(j);
            outputCell.innerHTML = inputCells[j].value;
          }
        }
  
        // Display output table
        var outputContainer = document.getElementById("outputContainer");
        outputContainer.innerHTML = "<h2>Kopírovatelná tabulka</h2>"; // Clear previous output
        outputContainer.appendChild(outputTable);
  
        // Add copy button
        var copyButton = document.createElement("button");
        copyButton.textContent = "Zkopírovat do schránky";
        copyButton.setAttribute("id", 'copyButton');
        copyButton.onclick = function() {
            // Copy the content of the output table to the clipboar
            let range = document.createRange();
            range.selectNode(outputTable);
            window.getSelection().removeAllRanges();
            window.getSelection().addRange(range);
            document.execCommand('copy');
            window.getSelection().removeAllRanges();
            alert("Copied!");
        };
        outputContainer.appendChild(copyButton);
      }
  

  </script>
